import React, { useState } from 'react';

const Chat = () => {
  const [messages, setMessages] = useState([
    {
      id: 1,
      sender: 'assistant',
      text: "Hi there! How can I help you today?",
      timestamp: new Date()
    }
  ]);
  const [newMessage, setNewMessage] = useState('');

  const handleSendMessage = () => {
    if (newMessage.trim()) {
      const userMessage = {
        id: messages.length + 1,
        sender: 'user',
        text: newMessage,
        timestamp: new Date()
      };
      
      setMessages([...messages, userMessage]);
      setNewMessage('');
      
      // Simulate assistant response
      setTimeout(() => {
        const assistantResponse = {
          id: messages.length + 2,
          sender: 'assistant',
          text: "I understand your question. Let me help you with that!",
          timestamp: new Date()
        };
        setMessages(prev => [...prev, assistantResponse]);
      }, 1000);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleSendMessage();
    }
  };

  return (
    <div className="min-h-screen bg-white flex flex-col">
      {/* Chat Messages */}
      <div className="flex-1 overflow-y-auto p-6 space-y-6">
        {messages.map((message) => (
          <div
            key={message.id}
            className={`flex ${message.sender === 'user' ? 'justify-end' : 'justify-start'}`}
          >
            <div className={`flex items-start space-x-3 max-w-xs lg:max-w-md ${message.sender === 'user' ? 'flex-row-reverse space-x-reverse' : ''}`}>
              {/* Avatar */}
              <div className={`w-10 h-10 rounded-full flex items-center justify-center ${
                message.sender === 'assistant' 
                  ? 'bg-gray-200' 
                  : 'bg-lime-400'
              }`}>
                {message.sender === 'assistant' ? (
                  <span className="text-gray-600 text-lg">ðŸ¤–</span>
                ) : (
                  <span className="text-white text-lg">ðŸ‘¤</span>
                )}
              </div>
              
              {/* Message Content */}
              <div className="flex flex-col">
                <div className="text-xs text-gray-500 mb-1">
                  {message.sender === 'assistant' ? 'Binsight Assistant' : 'You'}
                </div>
                <div className={`px-4 py-3 rounded-2xl ${
                  message.sender === 'assistant'
                    ? 'bg-gray-100 text-gray-800'
                    : 'bg-lime-400 text-white'
                }`}>
                  <p className="text-sm">{message.text}</p>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Message Input */}
      <div className="border-t border-gray-200 p-4">
        <div className="max-w-4xl mx-auto">
          <div className="flex items-center space-x-3 bg-gray-100 rounded-2xl px-4 py-3">
            {/* Attachment Button */}
            <button className="text-gray-500 hover:text-gray-700 transition-colors">
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15.172 7l-6.586 6.586a2 2 0 102.828 2.828l6.414-6.586a4 4 0 00-5.656-5.656l-6.415 6.585a6 6 0 108.486 8.486L20.5 13" />
              </svg>
            </button>
            
            {/* Message Input Field */}
            <input
              type="text"
              value={newMessage}
              onChange={(e) => setNewMessage(e.target.value)}
              onKeyPress={handleKeyPress}
              placeholder="Type your message..."
              className="flex-1 bg-transparent border-none outline-none text-gray-700 placeholder-gray-500"
            />
            
            {/* Send Button */}
            <button
              onClick={handleSendMessage}
              className="w-8 h-8 bg-lime-400 rounded-full flex items-center justify-center hover:bg-lime-500 transition-colors"
            >
              <svg className="w-4 h-4 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 19l9 2-9-18-9 18 9-2zm0 0v-8" />
              </svg>
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Chat;
